import styled from 'styled-components';

const Styled = styled.div`
    .ant-modal {
        height: 90vh;
    }
    input[type='date'] {
        line-height: 20px;
    }
    label {
        font-weight: unset;
        padding-bottom: 2px;
    }
    button {
        border: none;
    }
    .btn-form {
        display: flex;
        align-items: flex-end;
    }
    .btn-family-relationship {
        display: flex;
        justify-content: space-between;
    }
    .btn-add {
        background-color: #0000ff;
        color: #fff;
        height: 32px;
    }
    .btn-add:hover {
        background-color: #3333ff;
        color: #fff;
    }
    .btn-reset {
        background-color: orange;
        color: #fff;
        height: 32px;
    }
    .btn-reset:hover {
        background-color: #ffb833;
        color: #fff;
    }
    .anticon {
        font-size: 16px;
        padding: 0 3px;
    }
    .ant-col {
        padding: 0 4px;
    }
    .ant-form-item-control-input-content {
        display: flex;
    }
    .ant-table-thead .ant-table-cell {
        background-color: #373e58;
        color: #fff;
    }
`;
export default Styled;
